import React, {Component} from 'react';
import PropTypes from 'prop-types';
import {connect} from 'react-redux';

import {Collapse} from 'antd';

const {Panel} = Collapse;

class PresentedQuestions extends Component {
    render() {
        console.log(this.props);
        // const questions = typeof this.props.questions === 'undefined' ? [] : this.props.questions;
        const presentedQuestions = this.props.questions.inputtedQuestions.map(questionItem => (
            <Collapse defaultActiveKey={['1']}>
                <Panel header={questionItem.title} key={questionItem.title}>
                    {
                        questionItem.answers.map((answer, subindex) =>
                            <p>{answer}</p>
                        )
                    }
                </Panel>
            </Collapse>
        ));
        return (
            <div>
                <h3>Created questions</h3>
                {presentedQuestions}
            </div>
        );
    }
}

PresentedQuestions.propTypes = {
    questions: PropTypes.object.isRequired
};

// const mapStateToProps = (state) => ({
//     questions: state.inputtedQuestions
// });

const mapStateToProps = (state) => {
    console.log(state.questions);

    return {
        questions: state.questions
    };
};

export default connect(mapStateToProps, null)(PresentedQuestions);
